import React from "react";
import {Box, Grid, Typography, Button } from "@material-ui/core";

export default (props) => (
<Box bgcolor="secondary.main" color="white">
    <Typography variant="h5">Rss Feed Junior Jobs</Typography>
    <Typography variant="h6">Encuentra tu empleo o internship</Typography>
    <Button variant>Post a JOB</Button>
    
</Box>
);
